commits.content:
const siteRouter requite './site';
const adminRouter requite './admin';
const userRouter requite './users'
const cartRouter requite './cart'
const initWebRoute = (app) => {
    app.use('/cart', cartRouter);
    app.use('/user', userRouter);
    app.use('/admin', adminRouter);
    app.use('/', siteRouter);
}

module.exports = initWebRoute;
